import {
    VStack,
    ButtonGroup,
    FormControl,
    Button,
    FormErrorMessage,
    FormLabel,
    Input, Heading
} from "@chakra-ui/react";
import {useFormik} from "formik";

export const Login = () => {
    const formik = useFormik();

    return (
        <>
            <VStack
                as={"form"}
                w={{base: "90%", md: "500px"}}
                m={"auto"}
                justify={"center"}
                h={"100vh"}
                spacing={"1rem"}
            >
                <Heading>
                    Log In
                </Heading>
                <FormControl>
                    <FormLabel fontSize={"lg"}>Username</FormLabel>
                    <Input name={"username"} placeholdeer={"Enter username"} autoComplete={"off"} size={"lg"}/>
                    <FormErrorMessage>Invalid username</FormErrorMessage>
                </FormControl>

                <FormControl>
                    <FormLabel fontSize={"lg"}>Password</FormLabel>
                    <Input type={"password"} name={"password"} placeholdeer={"Enter password"} size={"lg"}
                           autoComplete={"off"}/>
                    <FormErrorMessage>Invalid password</FormErrorMessage>
                </FormControl>

                <ButtonGroup pt={"1rem"}>
                    <Button colorScheme={"teal"} type={"submit"}>Log in</Button>
                    <Button>Create Account</Button>
                </ButtonGroup>
            </VStack>
        </>
    );
};
